import React from "react";
import { createRoot } from "react-dom/client";
import App from "./App";

const container = document.getElementById("app");
if (container) {
  const root = createRoot(container);
  root.render(<App />);
} else {
  console.error("El contenedor de destino no es un elemento DOM.");
}
